import React from 'react';
import styled from 'styled-components';
import logo from '../img/logo.png';

const Container = styled.div`
  flex:1;
  background-color: #202020;
  height:100vh;
  color:white;
  font-size: 14px;
`;

//   height:5vh mane holo ei component total jottuk space pae tar 5% nibe.. ekhane 00vh mane puratai nibe

const Wrapper = styled.div`
  padding:18px 26px;
`;

const Logo = styled.div`
  display:flex;
  align-items:center;
  gap:5px;
  font-weight:bold;
  margin-bottom: 25px;
`;

const Img = styled.img`
  height: 25px;
`;


const Item = styled.div`
  display:flex;
  align-items:center;
  gap: 20px;
  cursor:pointer;
`;


const Menu = () => {
  return (
    <Container>
      <Wrapper>
        <Logo>
          <Img src={logo}/>
          FahimTube
        </Logo>
        Items
      </Wrapper>
    </Container>
  )
}

export default Menu
